import './Chart.css';

const Chart = props => {
    return (
        <div className="chart">
            {props.dataPoints.map(dataPoint => {
                <ChartBar key={dataPoint.label}
                            value={dataPoint.value}
                            label={dataPoint.value}
                            maxValue={null} 
                />

            })}
        </div>)
}

export default Chart;
